use std::collections::HashMap;
use std::time::Instant;
use zpl_forge::{
    forge::{pdf::PdfBackend, png::PngBackend},
    Resolution, Unit, ZplEngine, ZplForgeBackend,
};

fn run_test<B>(zpl: &str, width: Unit, height: Unit, backend: B, name: &str)
where
    B: ZplForgeBackend,
{
    run_test_with_vars(zpl, width, height, backend, name, &HashMap::new());
}

fn run_test_with_vars<B>(
    zpl: &str,
    width: Unit,
    height: Unit,
    backend: B,
    name: &str,
    vars: &HashMap<String, String>,
) where
    B: ZplForgeBackend,
{
    let start_time = Instant::now();
    let resolution = Resolution::Dpi203;

    let document = ZplEngine::new(zpl, width, height, resolution);
    if let Err(err) = document {
        panic!("[{}] Error parsing ZPL: {}", name, err);
    }
    let document = document.unwrap();

    let render_start = Instant::now();
    let result = document.render(backend, vars);
    if let Err(err) = result {
        panic!("[{}] Error rendering: {:?}", name, err);
    }
    let render_duration = render_start.elapsed();
    println!("[{}] Rendering took: {:?}", name, render_duration);

    let bytes = result.unwrap();
    let file_path = format!("{}", name);
    std::fs::write(&file_path, &bytes).expect("Failed to write output file");

    let total_duration = start_time.elapsed();
    println!(
        "[{}] Total process (including writing) took: {:?}",
        name, total_duration
    );
}

#[test]
fn test_01() {
    let zpl_input = r#"
        ^XA

        ^FX Top section with logo, name and address.
        ^CF0,60
        ^FO50,50^GB100,100,100^FS
        ^FO75,75^FR^GB100,100,100^FS
        ^FO93,93^GB40,40,40^FS
        ^FO220,50^FDIntershipping, Inc.^FS
        ^CF0,30
        ^FO220,115^FD1000 Shipping Lane^FS
        ^FO220,155^FDShelbyville TN 38102^FS
        ^FO220,195^FDUnited States (USA)^FS
        ^FO50,250^GB700,3,3^FS

        ^FX Second section with recipient address and permit information.
        ^CFA,30
        ^FO50,300^FDJohn Doe^FS
        ^FO50,340^FD100 Main Street^FS
        ^FO50,380^FDSpringfield TN 39021^FS
        ^FO50,420^FDUnited States (USA)^FS
        ^CFA,15
        ^FO600,300^GB150,150,3^FS
        ^FO638,340^FDPermit^FS
        ^FO638,390^FD123456^FS
        ^FO50,500^GB700,3,3^FS

        ^FX Third section with bar code.
        ^BY5,2,270
        ^FO100,550^BC^FD12345678^FS

        ^FX Fourth section (the two boxes on the bottom).
        ^FO50,900^GB700,250,3^FS
        ^FO400,900^GB3,250,3^FS
        ^CF0,40
        ^FO100,960^FDCtr. X34B-1^FS
        ^FO100,1010^FDREF1 F00B47^FS
        ^FO100,1060^FDREF2 BL4H8^FS
        ^CF0,190
        ^FO470,955^FDCA^FS

        ^XZ
    "#;

    run_test(
        zpl_input,
        Unit::Inches(4.0),
        Unit::Inches(6.0),
        PngBackend::new(),
        "test_01.png",
    );
    run_test(
        zpl_input,
        Unit::Inches(4.0),
        Unit::Inches(6.0),
        PdfBackend::new(),
        "test_01.pdf",
    );
}

